import '../../App.css';
import { Link } from 'react-router-dom';
import foto from '../../images/earth.gif';
import { useEffect } from 'react';
import { Blob } from 'react-blob'
import './Home.css';

export default function DVox() {

    useEffect(() => {
        window.scrollTo(0, 0)
      }, [])

    return (
        <>
            <Link to='/projects'>
                Go back to projects
            </Link>
            <div className="dvoxtext">
            <h1>DVox</h1>
            </div>
            {/* this is the second section with the image of DVox and description */}
            <div className="home-secBlack">
                    <div className="homeFlex">
                        <div className="description-pos-left">
                            <h1 style={{ color: "white" }}>
                                Dolor elit cupidatat consequat veniam labore aliqua consequat consequat aliqua est reprehenderit reprehenderit veniam in. Proident magna aute commodo in ea. Nisi eu ea eiusmod excepteur Lorem incididunt. Tempor tempor non ex laborum mollit. Esse elit laboris sunt et officia labore cillum do. Proident ipsum incididunt fugiat mollit sunt sint labore laboris excepteur ullamco consectetur ex et laboris. Amet excepteur aute culpa officia culpa nostrud sint est et enim.
                            </h1>
                        </div>
                        <div className="bg-Logo-right">                       
                        </div>
                    </div>                 
                </div>

                {/* this is the third section with an image of DVox and description */}
                <div className="home-sec">
                        <div className="homeFlex">
                        <div className="bg-Logo-right">

                                <Blob size="65vh" className="blobReverse">
                                    Photo
                                </Blob>                           
                        </div>
                        <div className="description-pos">
                            <h1>Anim et qui esse qui incididunt et fugiat aliqua ipsum amet sit anim. Consectetur in cillum anim sit velit minim anim velit irure ad magna enim sunt. Quis proident velit esse consectetur occaecat ut ad ipsum. Sunt voluptate officia irure pariatur nisi commodo. Ad velit do magna mollit esse id dolore do.</h1>
                        </div>
                    </div>                 
                </div>
                {/* this will be the form to join */}
                <div className="home-secBlack">                  
                </div>


        </>

    )

}
